import React, { Component } from "react";

class Function extends Component {
  render() {
    return (
      <div className="container" onSubmit={this.handleSubmit}>
        <div class="row">
          <form class="col s12">
            <div class="row">
              <div class="input-field col s12">
                <input
                  id="email"
                  type="email"
                  class="validate"
                  onChange={this.handleInput}
                />
                <label for="email">Your todos</label>
                <span
                  class="helper-text"
                  data-error="wrong"
                  data-success="right"
                ></span>
              </div>
            </div>
          </form>
        </div>
      </div>
    );
  }
}
export default Function;
